import React, { useState } from "react";
import axios from "axios";

function StudentDashboard() {
    const [topic, setTopic] = useState("");
    const [description, setDescription] = useState("");

    const handleCreate = async () => {
        await axios.post("http://localhost:5000/api/consultations/create", 
            { topic, description }, 
            { headers: { Authorization: `Bearer ${localStorage.getItem("token")}` } }
        );
        alert("Consultation request created!");
    };

    return (
        <div>
            <h2>Student Dashboard</h2>
            <input placeholder="Topic" onChange={(e) => setTopic(e.target.value)} />
            <input placeholder="Description" onChange={(e) => setDescription(e.target.value)} />
            <button onClick={handleCreate}>Request Consultation</button>
        </div>
    );
}

export default StudentDashboard;
